The Human Centipede (First Sequence)

Nederland / Verenigd Koninkrijk
Horror
90 minuten

geregisseerd door Tom Six
met Dieter Laser, Ashley C. Williams en Ashlynn Yennie

De internationaal gerespecteerde chirurg Dr Josef, gespecialiseerd 
in het opereren van Siamese tweelingen, heeft een eigenaardige visie 
op de toekomst van het menselijk ras. Twee knappe vrouwelijke 
Amerikaanse toeristen stranden op zijn luxeuze landgoed. De volgende 
dag worden ze echter, net als een Japanse man, wakker in zijn kelder. 
Maar de chirurg is niet van plan om ze net als de Siamese tweelingen 
uit elkaar te halen, maar juist om ze samen te voegen.

